class Solution {

    /**
     * @param Integer[] $heights
     * @param Integer[][] $queries
     * @return Integer[]
     */
    function leftmostBuildingQueries($heights, $queries) {
        $n = count($heights);
        $ans = [];

        foreach ($queries as $query) {
            list($a, $b) = $query;
            if ($a == $b) {
                $ans[] = $a; // Alice and Bob are in the same building.
                continue;
            }
            if ($a > $b || $heights[$a] >= $heights[$b]) {
                $ans[] = -1; // Alice cannot move right or Alice's building is not shorter than Bob's.
                continue;
            }

            $leftmost = -1;
            $maxHeight = $heights[$a];
            for ($i = $a + 1; $i <= $b; $i++) {
                if ($heights[$i] > $maxHeight) {
                    if ($leftmost == -1) $leftmost = $i;
                    $maxHeight = $heights[$i];
                    if ($maxHeight >= $heights[$b]) break; // Found a building as high as or higher than Bob's before reaching Bob.
                }
            }
            $ans[] = ($maxHeight >= $heights[$b]) ? $leftmost : -1;
        }

        return $ans;
    }
}
